namespace App\Forms{use\App\Forms\Fields,\App\Models,\MvcCore\Ext\Form;class Questionnaire extends Base{public$Id='questionnaire';public$CssClass='questionnaire';public$TemplatePath='questionnaire';public$Translate=TRUE;public$PersonsForm=TRUE;/** @var \App\Models\Questionnaire */protected$questionnaire;/** @var \App\Models\Question[] */protected$questions=array();public function SetQuestionnaire(Models\Questionnaire$questionnaire){$this->questionnaire=$questionnaire;$this->questions=$questionnaire->GetQuestions();$this->PersonsForm=$this->questionnaire->PersonsForm;return$this;}public function Init(){parent::Init();$this->initColumnsCount();$this->AddField(new Form\ResetButton(array('name'=>'reset','value'=>'Reset questionnaire','cssClasses'=>array('button','button-green',$this->Controller->GetView()->DisplayFacebookShare?'fb-share-beside':'',$this->PersonsForm?'':'no-person-form'),)));if($this->PersonsForm)$this->initPersonFields();$this->initQuestionsFields();$this->AddField(new Form\SubmitButton(array('name'=>'send','value'=>'Send questionnaire','cssClasses'=>array('button','button-green'),)));return$this;}protected function initPersonFields(){$age=new Form\Number(array('name'=>'person_age','label'=>'Age','required'=>TRUE,'cssClasses'=>array('person','number','age'),'controlWrapper'=>'{control}&nbsp;'.call_user_func($this->Translator,'years'),));$sex=new Form\RadioGroup(array('name'=>'person_sex','label'=>'Gender','required'=>TRUE,'cssClasses'=>array('person','radio-group','sex'),'options'=>Models\Person::$SexOptions,));$edu=new Form\RadioGroup(array('name'=>'person_edu','label'=>'Highest education level','required'=>TRUE,'cssClasses'=>array('person','radio-group','edu'),'options'=>Models\Person::$EducationOptions,'templatePath'=>'fields/field-group-with-columns','columns'=>!empty($this->formColumnsCount)?$this->formColumnsCount:1,'columns'=>empty($this->formColumnsCount)?3:$this->formColumnsCount));$job=new Form\RadioGroup(array('name'=>'person_job','label'=>'I